import React, {Component} from 'react';

class Why extends Component {
    render(){
    return(
        <div className="Container">
            <div>1 Du 100% Coton bio,
                Certfie à notre cartigan "Atelier Unes" une douceur inagalée
            </div>
            <div>
                2 Un tricotage avec deux fils,
                On peut le dire notre cartigan est pas là pour ce détentre.
            </div>
            <div>
                3 Une maille en coton bio certifié gots,
                Aucune boulouche.
            </div>
        </div>

    )
}
}

export default Why
